import React from 'react'
import "./SignIn.css"
import logo from ".."

function SignIn() {
  return (
    <div className='signIn'>
        <div className="loginForm">
            <img className='signInlogo' src={logo} alt="" />
        </div>
    </div>
  )
}

export default SignIn
